import { Component } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { MatTableDataSource } from '@angular/material/table';
import { Trace } from 'src/models/trace';
import { DEFAULT_SIZE } from '../list-users/list-users.component';
import { NgbModal } from '@ng-bootstrap/ng-bootstrap';
import { TraceService } from 'src/services/trace.service';
import { BrouillonService } from '../../services/brouillon.service';
import { Router } from '@angular/router';
import { PageEvent } from '@angular/material/paginator';
import { HttpErrorResponse } from '@angular/common/http';
import Swal from "sweetalert2";

@Component({
  selector: 'app-list-brouillons',
  templateUrl: './list-brouillons.component.html',
  styleUrls: ['./list-brouillons.component.css']
})
export class ListBrouillonsComponent {
  dataSource: MatTableDataSource<any> ;
  public traces!: Trace[];
  public editTrace!: Trace;
  public deleteTrace!: Trace;
  displayedColumns: string[] = ['ID','label','longitudes','latitudes','modif','suppression','valider'];
  updateTraceForm!:FormGroup
  closeResult = '';

  totalRows = 0;
  pageSize = DEFAULT_SIZE;
  currentPage = 0;

  pageSizes = [3, 5, 7];
  index:number=0;

  constructor(private formBuilder : FormBuilder,private modalService: NgbModal,private traceService: TraceService,private brouillonService: BrouillonService,public router: Router){
    this.dataSource = new MatTableDataSource<any>([]);
  }

  ngOnInit() {
    this.updateTraceForm=this.formBuilder.group({
      label: [null,Validators.required],
      longitudes: [null,Validators.required],
      latitudes: [null,Validators.required],


    })
    this.getBrouillons();
  }
  pageChanged(event: PageEvent) {
    this.currentPage = event.pageIndex;
    console.log(this.currentPage)
    this.getBrouillons();
  }
  open(content: any) {
    this.modalService.open(content, { ariaLabelledBy: 'modal-basic-title' }).result.then((result) => {
      this.closeResult = `Closed with: ${result}`;
    });
  }
  applyFilter(event: Event, column: string) {
    const filterValue = (event.target as HTMLInputElement).value;
    this.dataSource.filter = filterValue.trim().toLowerCase();


    if (this.dataSource.paginator) {
      this.dataSource.paginator.firstPage();
    }
  }
  onFilterInput(event: Event, column: string) {
    const filterValue = (event.target as HTMLDivElement).innerText;

    this.dataSource.filterPredicate = (data: any, filter: string) => {
      const columnValue = data[column];

      if (typeof columnValue === 'string') {
        return columnValue.trim().toLowerCase().includes(filter);
      } else if (typeof columnValue === 'number') {
        // Convert both the column value and filter to strings for comparison
        return columnValue.toString().includes(filter);
      }

      return false; // Return false for unsupported types
    };

    this.dataSource.filter = filterValue.trim().toLowerCase();
  }

  replaceColumnName(column: string, replacementText: string) {

    const columnIndex = this.displayedColumns.indexOf(column);
    if (columnIndex !== -1) {
      this.displayedColumns[columnIndex] = replacementText;
    }

  }


  public getBrouillons(): void {
    this.traceService.getBrouillons().subscribe(
      (response: Trace[]) => {
        this.traces = response;
        this.dataSource.data=response;
        this.totalRows=this.dataSource.data.length
        console.log(this.traces);
      },
      (error: HttpErrorResponse) => {
        alert(error.message);
      }
    );
  }

  public onAddTrace(): void {
    this.traceService.addTrace(this.updateTraceForm.value).subscribe(
      (response: Trace) => {
        Swal.fire({
          icon: 'success',
          title: 'Trace ajoutée avec succés',
          showConfirmButton: false,
          timer: 1500
        })
        console.log(response);
        this.getBrouillons();
        console.log("trace ajoutée")
      },
      (error: HttpErrorResponse) => {
        alert(error.message);
      }
    );
  }

  OnUpdateTrace(index:number){
    this.traceService.updateTrace(this.updateTraceForm.value,index).subscribe(
      (trace:Trace)=>{
        Swal.fire({
          icon: 'success',
          title: 'Trace mise à jour avec succés',
          showConfirmButton: false,
          timer: 1500
        })

        console.log("Trace updated");
        this.getBrouillons()
      },
      (error)=>{
        console.log("Trace not updated");
      }
    )
  }
  getRowNumber(index: number): number {
    return index + 1;
  }
  public onDeleteTrace(traceId: number): void {
    this.traceService.deleteTrace(traceId).subscribe(
      (response: void) => {
        Swal.fire({
          icon: 'success',
          title: 'Trace supprimé avec succés',
          showConfirmButton: false,
          timer: 1500
        })
        console.log(response);
        this.getBrouillons();
      },
      (error: HttpErrorResponse) => {
        alert(error.message);
      }
    );
  }

  public onValiderTrace(traceId: number): void {
    this.brouillonService.validerTrace(traceId).subscribe(
      (response: Trace) => {
        Swal.fire({
          icon: 'success',
          title: 'Brouillon validé avec succés',
          showConfirmButton: false,
          timer: 1500
        })
        console.log(response);
        this.getBrouillons();
      },
      (error: HttpErrorResponse) => {
        alert(error.message);
      }
    );
  }

  public onOpenModal(trace: Trace, mode: string): void {
    const container = document.getElementById('main-container');
    const button = document.createElement('button');
    button.type = 'button';
    button.style.display = 'none';
    button.setAttribute('data-toggle', 'modal');
    if (mode === 'add') {
      $("#addTraceModal").prependTo("body");
      button.setAttribute('data-target', '#addTraceModal');
    }
    if (mode === 'edit') {
      $("#updateTraceModal").prependTo("body");
      this.editTrace = trace;
      button.setAttribute('data-target', '#updateTraceModal');
    }
    if (mode === 'delete') {
      $("#deleteTraceModal").prependTo("body");
      this.deleteTrace = trace;
      button.setAttribute('data-target', '#deleteTraceModal');
    }
    container!.appendChild(button);
    button.click();
  }
}

<link href="https://fonts.googleapis.com/icon?family=Material+Icons" rel="stylesheet">
<div style="display: flex; flex-direction: row">
<h1>
  Liste des brouillons
</h1>


</div>
<div class="table-container">
  <table style="width: 256%;" mat-table [dataSource]="dataSource" class="mat-elevation-z8">


    <ng-container matColumnDef="ID">
      <th style="color: white;font-family: Bahnschrift"  mat-header-cell *matHeaderCellDef> No. </th>
      <td mat-cell *matCellDef="let element; let i = index"> {{getRowNumber(i)}} </td>
    </ng-container>


    <ng-container matColumnDef="label">
      <th style="color: white;font-family: Bahnschrift"  mat-header-cell *matHeaderCellDef>
        <div contenteditable="true" id="column-label" (input)="onFilterInput($event, 'label')" #headerContent> Label </div>
      </th>
      <td mat-cell *matCellDef="let element"> {{element.label}} </td>
    </ng-container>


    <ng-container matColumnDef="longitudes">
      <th style="color: white;font-family: Bahnschrift"  mat-header-cell *matHeaderCellDef>  <div contenteditable="true" id="column-longitudes" (input)="onFilterInput($event, 'longitudes')" #headerContent> Longitudes </div> </th>
      <td mat-cell *matCellDef="let element"> {{element.longitudes}} </td>
    </ng-container>


    <ng-container matColumnDef="latitudes">
      <th style="color: white;font-family: Bahnschrift"  mat-header-cell *matHeaderCellDef>  <div contenteditable="true" id="column-latitudes" (input)="onFilterInput($event, 'latitudes')" #headerContent> Latitudes </div> </th>
      <td mat-cell *matCellDef="let element"> {{element.latitudes}} </td>
    </ng-container>


    <ng-container  matColumnDef="modif">
      <th style="color: white;font-family: Bahnschrift"  mat-header-cell *matHeaderCellDef> Modif
      <td  mat-cell *matCellDef="let i">
        <ng-template #content let-modal>
          <div class="mat-dialog-container">
            <div class="modal-header">
              <div class="dialog-title">Modifier Trace</div>
              <button class="btn-close" aria-label="Close" (click)="modal.dismiss()" >
                <mat-icon>close</mat-icon>
              </button>
            </div>
            <div class="dialog-body">
              <form [formGroup]="updateTraceForm">
                <div class="row">

                  <div  class="col-md-11">
                    <div style="margin-left: 20px" class="form-group">
                      <label style="color:midnightblue ;font-family: Bahnschrift" class="label" for="label">Label</label>
                      <input formControlName="label" type="text" class="form-control" name="label" id="label" placeholder="label ">
                    </div>
                  </div>


                  <div  class="col-md-11">
                    <div style="margin-left: 20px" class="form-group">
                      <label style="color:midnightblue ;font-family: Bahnschrift" class="label" for="longitudes">Longitudes</label>
                      <input formControlName="longitudes" type="text" class="form-control" name="Longitudes" id="Longitudes" placeholder="Longitudes">
                    </div>
                  </div>


                  <div  class="col-md-11">
                    <div style="margin-left: 20px" class="form-group">
                      <label style="color:midnightblue ;font-family: Bahnschrift" class="label" for="latitudes">Latitudes</label>
                      <input formControlName="latitudes" type="text" class="form-control" name="latitudes" id="latitudes" placeholder="latitudes">
                    </div>
                  </div>




                  <br>

                </div>
              </form>
            </div>
            <br>
            <br>
            <div class="dialog-footer">
              <button class="btn btn-outline-dark" (click)="OnUpdateTrace(i.id);modal.dismiss()">Save</button>
            </div>
          </div>
        </ng-template>

        <button style="position:relative;bottom:30px"  mat-icon-button class="removeCart" (click)="open(content)">
          <hr>
          <pre >{{ closeResult }}</pre>
          <mat-icon>edit</mat-icon>
        </button>

      </td>
    </ng-container>

    <ng-container  matColumnDef="suppression">
      <th style="color: white;font-family: Bahnschrift"  mat-header-cell *matHeaderCellDef >Suppression</th>
      <td mat-cell *matCellDef="let element ">
        <button (click)="onDeleteTrace(element['id'])" mat-icon-button class="removeCart"  >
          <mat-icon>delete</mat-icon>
        </button>
      </td>
    </ng-container>

    <ng-container  matColumnDef="valider">
        <th style="color: white;font-family: Bahnschrift"  mat-header-cell *matHeaderCellDef >Valider</th>
        <td mat-cell *matCellDef="let element ">
          <button (click)="onValiderTrace(element['id'])" mat-icon-button class="acceptButton"  >
            <mat-icon>check_circle</mat-icon>
          </button>
        </td>
      </ng-container>

    <tr mat-header-row  class="HEADER" *matHeaderRowDef="displayedColumns"></tr>
    <tr mat-row *matRowDef="let row; columns: displayedColumns;"></tr>


  </table>
</div>
